import styled from 'styled-components'

export const DeleteButton = styled.button`
    text-decoration: none;
    border: 0.5px solid black;
    height: 15px;
    font-size: 10px;
    background-color:white;
    border: 1px solid #d3d3d3;
    box-sizing:border-box;
`
